import { SET_IMGDATA ,SET_PLAYER} from './types';

export const setIMGDATA = (imgdata) => ({
  type: SET_IMGDATA,
  payload: imgdata,
});

export const setPlayer = (player) => ({
  type :SET_PLAYER,
  payload:player
})
